import React, { Component } from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min';
//import Row from 'react-bootstrap/Row';
//import Col from 'react-bootstrap/Col';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import ListGroup from 'react-bootstrap/ListGroup';

import { Route, NavLink, BrowserRouter } from 'react-router-dom';

import ColumnChart from './column charts/Column Chart';
import BarChart from './column charts/Bar Chart';

import StackedBarChart from './column charts/Stacked Bar Chart';

class Template extends Component {
  render() {
    return (
      <div>
        <Navbar bg="dark" variant="dark">
          <button className="d-lg-none toggle-sidebar">
            <span className="navbar-toggler-icon"></span>
          </button>

          <span className="hidden-xs text-muted">React</span>
        </Navbar>
        <BrowserRouter>
          <div className="row">
            <Nav to="/" className="flex-sm-column" id="sidebar">
              <ListGroup className="nav nav-sidebar flex-sm-column">
                <ListGroup.Item>
                  <a
                    href="#columnCharts"
                    data-toggle="collapse"
                    aria-expanded="false"
                    className="dropdown-toggle"
                  >
                    <span>COLUMN & BAR CHARTS</span>
                  </a>
                </ListGroup.Item>

                <ListGroup>
                  <ListGroup className="sub-menu collapse" id="columnCharts">
                    <ListGroup.Item>
                      {' '}
                      <NavLink to="/column-chart">Column Chart</NavLink>
                    </ListGroup.Item>
                    <ListGroup.Item>
                      {' '}
                      <NavLink to="/bar-chart">Bar Chart</NavLink>
                    </ListGroup.Item>

                    <ListGroup.Item>
                      {' '}
                      <NavLink to="/stacked-bar-chart">
                        Stacked Bar Chart
                      </NavLink>
                    </ListGroup.Item>
                  </ListGroup>
                </ListGroup>
                <ListGroup.Item
                  role="separator"
                  className="divider"
                ></ListGroup.Item>
              </ListGroup>
            </Nav>

            <div
              className="col"
              xl={{ span: 7, offset: 3 }}
              lg={{ span: 8, offset: 3 }}
              xs={{ span: 8, offset: 2 }}
            >
              <Container>
                <div className="content">
                  <Route exact path="/" component={ColumnChart} />

                  <Route path="/column-chart" component={ColumnChart} />
                  <Route path="/bar-chart" component={BarChart} />

                  <Route
                    path="/stacked-bar-chart"
                    component={StackedBarChart}
                  />
                </div>
              </Container>
            </div>
          </div>
        </BrowserRouter>
      </div>
    );
  }
}

export default Template;
